import React from "react";
import "./TechStack.scss";

const techStack = [
  { name: "JavaScript", logo: "/img/js.png" },
  { name: "HTML", logo: "/img/html.png" },
  { name: "CSS", logo: "/img/css.png" },
  { name: "Tailwind CSS", logo: "/img/tailwind.png" },
  { name: "React Native", logo: "/img/react-native.png" },
  { name: "React.js", logo: "/img/react.png" },
  { name: "Node.js", logo: "/img/node.png" },
  { name: "Express.js", logo: "/img/express.png" },
  { name: "Vercel", logo: "/img/vercel.png" },
  { name: "Git", logo: "/img/git.png" },
  { name: "GitHub", logo: "/img/github.png" },
  { name: "Supabase", logo: "/img/supabase.png" },
  { name: "MongoDB", logo: "/img/mongodb.png" },
  { name: "Firebase", logo: "/img/firebase.png" },
];

const TechStack = () => {
  return (
    <section className="techstack--section">
      <h2 className="techstack--title">Technologies & Tools</h2>
      <div className="techstack--container">
        {techStack.map((tech, index) => (
          <div className="techstack--item" key={index}>
            <img src={tech.logo} alt={tech.name} className="tech--logo" />
            <p>{tech.name}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default TechStack;
